    if (document.activeElement == chatInput) {
        return;
    }
    if (e.which == 32) {
        usdfe.bhopActive = true;
        e.stopPropagation();
    } else if (e.which == 18) {
        usdfe.NASAPeak = false && usdfe.getVal('NASA Peak') == 7;
    }
